import { redisCache } from '../../packages/redis-cache';
import * as fs from 'fs';

const getFromCache = async (key) => {
  return new Promise((resolve, reject) => {
    redisCache.get(key, (err, reply) => {
      if (err) reject(err);
      resolve(reply ? JSON.parse(reply) : null);
    });
  });
};

export default async function handler(req, res) {
  const key = req.query.key;
  let data;

  try {
    data = await getFromCache(key);
    if (!data) {
      // Fetch from API or database
      data = fs.readFileSync('/path/to/data.json');
      redisCache.set(key, JSON.stringify(data), 'EX', 60); // Cache for 1 minute
    }
  } catch (err) {
    console.error(err);
    res.status(500).json({ error: err.message });
  }

  res.status(200).json({ data });
}
